import React from 'react';
import { Route,  BrowserRouter, Routes } from 'react-router-dom';
import Home from '../src/containers/Home';


const Router = () => {
    return (
        <>
            <BrowserRouter>
            <Routes>
                <Route exact path={'/'} element={<Home/>} />
                </Routes>
            </BrowserRouter>
        </>
    );
};
export default Router;
